import React, { Component } from 'react';
import Login from '../Login/Login';
import Register from '../Register/Register';
import PreLogin from '../Home/PreLogin';
import Savings from '../Savings/Savings';
import CreditHistory from '../CreditHistory/CreditHistory';
import Dashboard from '../Dashboard/Dashboard';


import { BrowserRouter as Router, Route, Link, NavLink, Switch } from "react-router-dom";

function App () {
    return (
        <Router>
        <div className="App">
            <h1>
                Welcome to GRO! The journey to saving money and building/restoring your credit starts here.
            </h1>
            <NavLink to="/home">Home</NavLink><br />
            <NavLink to="/login">Login</NavLink><br />
            <NavLink to="/register">Register</NavLink><br />
            <NavLink to="/savings">Savings</NavLink><br />
            <NavLink to="/credithistory">Credit History</NavLink><br />

            <Switch>
            <Route path="/home" component={PreLogin}/>
            <Route path="/login" component={Login}/>
            <Route path="/register" component={Register}/>
            <Route path="/savings" component={Savings}/>
            <Route path="/credithistory" component={CreditHistory}/>
            <Route path="/dashboard" component={Dashboard}/>
            </Switch>
        </div>
        </Router>
    )
}

export default App;
